import Expense from './components/expenses'
import Card from './components/card'

function App() {
  const exp=[
    {
      name:"car",
      date: new Date(2023, 4, 1),
      price: 1000000
    },
    {
      name:'bike',
      date: new Date(2023, 3, 4),
      price : 100000
    },
    {
         name:"AC",
         date:new Date(2023, 1, 12),
         price: 30000
    }
  ]

  return (
    <Card>
      <h2>Let's get started!</h2>
      <Expense name={exp[0].name} date={exp[0].date} price={exp[0].price}></Expense>
      <Expense name={exp[1].name} date={exp[1].date} price={exp[1].price}></Expense>
      <Expense name={exp[2].name} date={exp[2].date} price={exp[2].price}></Expense>
    </Card>
  );
}

export default App;
